import React from 'react';
import axios from 'axios';
import './ProgramCard.css';
import { Badge } from 'reactstrap';

const updateAction = (actionName) => {
    console.log("Please Work", actionName)
    axios.post("/action" , {
        action: actionName
    })
}

const ProgramCard = ({ title, type, description, output }) => {

    return (
        <div class="containerElement">

            <div class="title">
                <h4>{title}&nbsp;</h4>
                <br/>
                <Badge color="light" pill> {type}</Badge>
            </div>

            <div class="description">
                <p>{description}</p>
            </div>

        </div>
    );

}

export default ProgramCard;

// Badge colors: Primary Secondary Success Danger Warning Info Light Dark
